import React, { ReactElement } from 'react';
import { Router } from '@reach/router';

import { Head, NestedPagesWrapper } from '@/components/common';
import { AboutPage, CoursePage, CoursesPage, HomePage } from '@/components/pages';

function App(): ReactElement {
  return (
    <div className="theme-light">
      {/* <Head isInitial /> */}

      <Router>
        <HomePage path="/" />
        <NestedPagesWrapper path="courses">
          <CoursesPage path="/" />
          <CoursePage path=":courseId" />
        </NestedPagesWrapper>
        <AboutPage path="about" />
      </Router>
    </div>
  );
}

export default App;
